import React from 'react'
import loading from "../images/loading.gif";

const Loading = () => {
    return (
        <div style={{
            height: ""
        }}>
            <img src={loading} style={{
                width: "50px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center"
            }} />
        </div>
    )
}

export default Loading
